var body = document.querySelector(".body");

const popupOpen = document.querySelectorAll(".popup_open");
const popupClose = document.querySelectorAll(
  ".popup_close, .popup_substrate_close, .close_popup"
);
const popup = document.querySelector(".popup");

popupOpen.forEach((element) => {
  element.addEventListener("click", () => {
    body.style.overflow = "hidden";
    popup.style.display = "flex";
    setTimeout(() => {
      popup.classList.add("active");
    }, 1);
  });
});

popupClose.forEach((element) => {
  element.addEventListener("click", () => {
    body.style.overflow = "auto";
    popup.classList.remove("active");
    setTimeout(() => {
      popup.style.display = "none";
    }, 240);
  });
});

if (window.innerWidth < 991) {
  const menuOpen = document.querySelector(".menu_open");
  const menuClose = document.querySelectorAll(".menu_close, .menu_mobile_link");
  const menu = document.querySelector(".menu_wrapper");

  menuOpen.addEventListener("click", () => {
    let vh = window.innerHeight * 0.01;
    document.documentElement.style.setProperty("--vh", `${vh}px`);
    body.style.overflow = "hidden";
    menu.style.display = "flex";
    setTimeout(() => {
      menu.classList.add("active");
    }, 1);
  });

  menuClose.forEach((element) => {
    element.addEventListener("click", () => {
      body.style.overflow = "auto";
      menu.classList.remove("active");
      setTimeout(() => {
        menu.style.display = "none";
      }, 240);
    });
  });

  document.addEventListener("scroll", () => {
    let vh = window.innerHeight * 0.01;
    document.documentElement.style.setProperty("--vh", `${vh}px`);
  });
}

const animaElements = document.querySelectorAll("div[hidden-anim], div[arrow]");
const offset = "-5%";
const observer = new IntersectionObserver(
  (entries) => {
    entries.forEach((entry) => {
      if (entry.isIntersecting) {
        entry.target.classList.add("active");
      }
    });
  },
  {
    rootMargin: offset,
  }
);

animaElements.forEach((element) => {
  observer.observe(element);
});

const animaElements2 = document.querySelectorAll(
  ".animate_img_wrapper, div[animate_img], #main_section, .main_img_block, .header .container, .menu_progress_page, span[span-anim]"
);

const observer2 = new IntersectionObserver((entries) => {
  entries.forEach((entry) => {
    if (entry.isIntersecting) {
      entry.target.classList.add("active");
    }
  });
});

animaElements2.forEach((element) => {
  observer2.observe(element);
});

