var allSchemesProgress = document.querySelectorAll(".schem_item_progress");
var schem_imgs = document.querySelectorAll(".progress_img");
allSchemesProgress.forEach((element, index) => {
  element.addEventListener("click", () => {
    allSchemesProgress.forEach((other, indexOther) => {
      other.classList.remove("active");
      schem_imgs[indexOther].classList.remove("active");
    });
    element.classList.add("active");
    schem_imgs[index].classList.add("active");
  });
});

